import React from 'react';
import App from './images/brighten.jpg';

const Sdata=[
       {
        imgsrc:App,
        title:"Web development",
       },
       {
        imgsrc:App,
        title:"App development", 
       },
       {
        imgsrc:App,
        title:"Android development", 
       },
       {
        imgsrc:App,
        title:"Software development", 
       },
       {
        imgsrc:App,
        title:"Digital Marketing", 
       },
       {
        imgsrc:App,
        title:"AWS ", 
       }
];

export default Sdata;
